import './NavTab.css';
import React from 'react';
import { Link } from 'react-router-dom';

function NavTab() {
  return (
    <section className='navtab'>
      <ul className='navtab__links'>
        <li className='navtab__link-container'>
          <a className='navtab__link' href='#about-project-id'></a>
          {/* <Link className='navtab__link' to='#about-project-id'>О проекте</Link> */}
        </li>
        <li className='navtab__link-container'>
          <Link className='navtab__link' to='#techs-id'>
            Технологии
          </Link>
        </li>
        <li className='navtab__link-container'>
          <Link className='navtab__link' to='#'>
            Студент
          </Link>
        </li>
      </ul>
    </section>
  );
}

export default NavTab;
